// 地址选择
function  Address(){
	this.countryIndex = '';
	this.provinceIndex = '';
	this.cityIndex = '';
}
Address.prototype = {
	bindEvent:function(){
		var self = this;
		// 绑定事件
		$('body').on('click','.area-list a',function(event){
			event.preventDefault();
		})
		$('body').on('click','.address-tab:not(.on)',function(event){
			var index = $(this).index();
			if(!window.areaData){
				return false;
			}
			if(index == 0){
				self.setCountryDom();
			}
			if(index == 1){
				self.setProvinceDom();
			}
			if(index == 2){
				self.setCityDom();
			}
		})
		$('body').on('click','.area-list li',function(event){
			var district = $('.area-list').attr('data-name');
			if(district == 'country'){
				self.countryIndex = $(this).data('index');
				self.provinceIndex = '';
				self.cityIndex = '';
				self.setProvinceDom();
			}else if(district == 'province'){
				self.provinceIndex = $(this).data('index');
				self.cityIndex = '';
				self.setCityDom();
				if(!self.checkCity()){
					self.setChoosed();
				}
			}else if(district == 'city'){
				self.cityIndex = $(this).data('index');
				self.setChoosed();
			}
		})
		$('body').on('mouseover','.address-to',function(){
			$('.choose-address').show();
			if(!window.areaData){
				$('.area-list').html('loading……');
			}
		})
		$('body').on('mouseout','.address-to',function(){
			$('.choose-address').hide();
		})
	},
	createList:function(dataArr, type){
		var obj = this;
		var len = dataArr.length;
		if(len == 0){
			return ;
		}
		var i,li='',html='';
		for (i = 0; i < len; i++) {
			li = '<li data-value="'+dataArr[i].id+'" data-index ="'+ dataArr[i].index +'"><a href="" >'+dataArr[i].name+'</a></li>';
			html = html+li;
		}	
		return html;
	},
	setCountryDom:function(id){
		// 设置省份信息
		this.setTabs();

		var obj = this;

		var country = areaData.country;
		var countryLen = country.length;

		for (var i = 0; i < country.length; i++) {
			country[i].index = i;
		}
		var html = $(obj.createList(country, 'country'));
		var arealist = $('.area-list');
		arealist.html(html).attr('data-name','country');
		$('.address-tabs li').eq(0).addClass('on').siblings('li').removeClass('on');
		return obj;

	},
	setProvinceDom:function(id){
		this.setTabs();
		id = id ||window.areaData.country[this.countryIndex].id;
		var obj = this;
		var others = window.areaData.others;
		var len = others.length;
		var country = [];
		for(var i=0; i<len; i++){
			if(others[i].pid == id){
				others[i].index = i;
				country.push(others[i]);
			}
			var data = parseInt(obj.countryIndex) ? others[i].id : others[i].name;
			if(obj.countryIndex && data == obj.countryIndex){
				var defId = others[i].id;
			}
		}
		var html = $(obj.createList(country, 'country'));
		var arealist = $('.area-list');
		arealist.html(html).attr('data-name','province');
		$('.address-tabs li').eq(1).addClass('on').siblings('li').removeClass('on');
	},
	setCityDom:function(id){

		this.setTabs();
		if(!this.checkCity()){
			return;
		}
		id = id ||window.areaData.others[this.provinceIndex].id;

		var obj = this;
		var others = window.areaData.others;
		var len = others.length;
		var province = [];
		for(var i=0; i<len; i++){
			if(others[i].pid == id){
				others[i].index = i;
				province.push(others[i]);
			}
		}
		var html = $(obj.createList(province, 'city'));
		var arealist = $('.area-list');
		arealist.html(html).attr('data-name','city');
		$('.address-tabs li').eq(2).addClass('on').siblings('li').removeClass('on');
	},
	getCountryByIndex:function(){
		if(this.countryIndex!==''){
			return areaData.country[this.countryIndex].name;
		}else{
			return '请选择';
		}		
	},
	getProvinceByIndex:function(){
		if(this.countryIndex!==''&&this.provinceIndex!==''){
			return areaData.others[this.provinceIndex].name;
		}else{
			return '请选择';
		}

	},
	getcityByIndex:function(){
		if(this.countryIndex!==''&&this.provinceIndex!==''&&this.cityIndex!==''){
			return areaData.others[this.cityIndex].name;
		}else{
			return '请选择';
		}		
	},
	checkCity:function(id){
		// 检测是否有第三级菜单
		if(this.provinceIndex===''){
			return false;
		}
		id = id ||window.areaData.others[this.provinceIndex].id;
		var obj = this;
		var others = window.areaData.others;
		var len = others.length;

		for(var i=0; i<len; i++){
			if(others[i].pid == id){
				return true;
			}
		}
		return false;
	},
	setTabs:function(){

		$('.address-tabs li').eq(0).text(this.getCountryByIndex());
		$('.address-tabs li').eq(1).text(this.getProvinceByIndex());
		$('.address-tabs li').eq(2).text(this.getcityByIndex());
		if(this.countryIndex===''){
			$('.address-tabs li').eq(1).hide();
		}else{
			$('.address-tabs li').eq(1).show();
		}
		if(this.provinceIndex===''){
			$('.address-tabs li').eq(2).hide();
		}else{
			$('.address-tabs li').eq(2).show();
		}
		if(!this.checkCity()){
			$('.address-tabs li').eq(2).hide();
		}
	},
	setChoosed:function(){
		var res = '';
		var country = this.getCountryByIndex();
		country == '请选择'?'':country;
		var province = this.getProvinceByIndex();
		province == '请选择'?'':province;
		var city = this.getcityByIndex();
		if(city == '请选择'){
			city = '';
		}
		if(country!=''){
			res = country;
		}
		if(province != ''){
			res = res + province;
		}
		if(city != ''){
			res = res + city;
		}

		$(".choosed-address").html(res);
		$(".choose-address").hide();
	},
	setIndex:function(defCountry, defcountry, defprovince){
		var country = areaData.country;
		var cLen = country.length;
		var others = areaData.others;
		var oLen = others.length;
		var cid,pid
		if(defCountry){
			for (var i = 0; i < cLen; i++) {
				if(country[i].name == defCountry){
					this.countryIndex = i;
					cid = country[i].id;
					break;
				}
			}
		}
		if(defcountry){
			for (var j = 0; j < oLen; j++) {
				if(others[j].name == defcountry && others[j].pid == cid){
					this.provinceIndex = j;
					pid = others[j].id;
					break;
				}				
			}

		}

		if(defcountry&&defprovince){
			for (var j = 0; j < oLen; j++) {
				if(others[j].name == defprovince && others[j].pid == pid){
					this.cityIndex = j;
					break;
				}				
			}

		}

	},
	init:function(defCountry, defcountry, defprovince, selectCss, areaBox){
		var self = this;
		$.ajax({
			url : '/common/list-district-data',
			noLoad: true,
			success: function(data){
				if(data.status == 1){
					window.areaData = data.data;					
					self.setIndex(defCountry, defcountry, defprovince);
					self.setCountryDom();
				}
			}
		});
		this.bindEvent();
		this.setTabs();
	}

}

